import React, { useEffect } from "react";
import {
  Container,
  Form,
  FormGroup,
  Label,
  Input,
  Button,
  Row,
  Col,
  Alert
} from "reactstrap";

import { useDispatch, useSelector } from "react-redux";
import { registerUser, resetState } from "../Features/UserSlice";
import { useNavigate, Link } from "react-router-dom";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { schema } from "../Components/Validation/UserValidation";
import '../App.css';
import backgroundImage from '../Images/backgroud.jpg';

const Register = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const { isSuccess, isError, isLoading, message } = useSelector((state) => state.users);

  const {
    register,
    handleSubmit,
    formState: { errors, isSubmitted }
  } = useForm({
    resolver: yupResolver(schema),
    mode: "onSubmit"
  });

  const onSubmit = (data) => {
    const userData = {
      name: data.name,
      email: data.email,
      password: data.password,
      age: data.age,
      gender: data.gender
    };
    dispatch(registerUser(userData));
  };

  useEffect(() => {
    if (isSuccess) {
      setTimeout(() => {
        dispatch(resetState());
        navigate("/login");
      }, 2000);
    }
  }, [isSuccess, dispatch, navigate]);

  return (
    <div
      className="register-background"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <Container className="register-page py-4">
        <Row className="justify-content-center">
          <Col md={10} lg={8}>
            <h2 className="text-center register-title mb-4">Register for SaveWell</h2>

            {isError && (
              <Alert color="danger">{message || "Registration failed. Please try again."}</Alert>
            )}

            {isSuccess && (
              <Alert color="success">Registration successful! Redirecting to login...</Alert>
            )}

            <Form onSubmit={handleSubmit(onSubmit)} autoComplete="off">
              <FormGroup>
                <Label for="name" className="register-label">Full Name</Label>
                <Input id="name" type="text" {...register("name")} placeholder="Enter your name" />
                {isSubmitted && errors.name && <p className="text-danger">{errors.name.message}</p>}
              </FormGroup>

              <FormGroup>
                <Label for="email" className="register-label">Email</Label>
                <Input id="email" type="email" {...register("email")} placeholder="Enter your email" />
                {isSubmitted && errors.email && <p className="text-danger">{errors.email.message}</p>}
              </FormGroup>

              <FormGroup>
                <Label for="password" className="register-label">Password</Label>
                <Input id="password" type="password" {...register("password")} placeholder="Enter your password" />
                {isSubmitted && errors.password && <p className="text-danger">{errors.password.message}</p>}
              </FormGroup>

              <FormGroup>
                <Label for="confirmPassword" className="register-label">Confirm Password</Label>
                <Input id="confirmPassword" type="password" {...register("confirmPassword")} placeholder="Re-enter your password" />
                {isSubmitted && errors.confirmPassword && <p className="text-danger">{errors.confirmPassword.message}</p>}
              </FormGroup>

              <FormGroup>
                <Label for="age" className="register-label">Age</Label>
                <Input id="age" type="number" {...register("age")} placeholder="Enter your age" />
                {isSubmitted && errors.age && <p className="text-danger">{errors.age.message}</p>}
              </FormGroup>

              <FormGroup tag="fieldset">
                <Label className="register-label">Gender</Label>
                <FormGroup check>
                  <Label check>
                    <Input type="radio" value="male" {...register("gender")} /> Male
                  </Label>
                </FormGroup>
                <FormGroup check>
                  <Label check>
                    <Input type="radio" value="female" {...register("gender")} /> Female
                  </Label>
                </FormGroup>
                {isSubmitted && errors.gender && <p className="text-danger">{errors.gender.message}</p>}
              </FormGroup>

              <Button type="submit" className="register-button" block disabled={isLoading}>
                {isLoading ? "Registering..." : "Register"}
              </Button>

              <p className="mt-3 text-center">
                Already have an account? <Link to="/login">Login Here</Link>
              </p>
            </Form>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Register;
